// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import ListeClients from "./ListeClients";
import MAJClient from "./MAJClient";
import FiltreVille from "./FiltreVille.JS";
import FiltreCA from "./components/FiltreCA";

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">Liste des Clients</Link> |
        <Link to="/maj">Mettre Ã  Jour un Client</Link> |
        <Link to="/filtre-ville">Filtrer par Ville</Link> |
        <Link to="/filtre-ca">Filtrer par CA</Link>
      </nav>

      <Routes>
        <Route path="/" element={<ListeClients />} />
        <Route path="/maj" element={<MAJClient />} />
        <Route path="/filtre-ville" element={<FiltreVille />} />
        <Route path="/filtre-ca" element={<FiltreCA />} />
      </Routes>
    </Router>
  );
}

export default App;
